import React from 'react';


function ChooseActivity({join, message}) {
  return (
    <div className="ButtonList">
      Choose next activity?<br/>
      <button onClick={()=>props.join("washing")} >
        Wash
      </button>
      <button onClick={()=>props.join("dishes")} >
        Dishes
      </button>
      <button onClick={()=>props.join("studying")}>
        Study
      </button>
      <button onClick={props.message}>
        Send Message
      </button>
      <hr/>
    </div>
  );
}

export default ChooseActivity;
